import React, { useState } from "react";
import { Redirect } from "react-router-dom";
import "./Heading.css";
function Navbar2() {
  const [LogOut, setLogOut] = useState(false);
  const [faucet, setFaucet] = useState(false);
  function logOut() {
    localStorage.clear();
    setLogOut(true);
  }
  function handleFaucet() {
    setFaucet(true);
  }
  return (
    <div className="heading3">
      <button
        className="variable-width-btn-1 button-su fund-campaign-btn log"
        onClick={handleFaucet}
      >
        <span className="text">DONATION TOKEN FAUCET</span>
      </button>
      <button
        className="variable-width-btn-1 button-su fund-campaign-btn token"
        onClick={logOut}
      >
        <span className="text">LOG OUT</span>
      </button>

      {LogOut && <Redirect to="/landingPage" />}
      {faucet && <Redirect to="/tokenFaucet" />}
    </div>
  );
}
export default Navbar2;
